pragma solidity >=0.4.20 <0.9.0;

contract cryptoDorea {

    bytes32 private _secretHash;

    mapping(address=>uint256) private _usersAddress;
    mapping(address=>uint256[]) private _usersAuthToken;

    // define constructor to get fund on deploy stage
    constructor(string memory _secret) payable {

        _secretHash = keccak256(abi.encodePacked(_secret));

    }

    // Transfer Ether to Loyal Customers
    function pay(address recipient, uint256  amount, uint256 campaignCount, uint256 shoppingCount, string memory _secret, uint256 _encData, uint256 _decData, uint256 _saltHash) public payable{
        

        userAuthTokenCheck(recipient,_decData,_saltHash);

        userAuthorized(_secret);
        
        require(amount <= address(this).balance, "Insufficient balance");

        if(shoppingCount >= campaignCount){    

            // Transfer Ether to the receipnt address
            bool success = payable(recipient).send(amount);
            require(success, "Transfer failed");

            _usersAuthToken[recipient] = [_encData, _decData];

        }else{

            revert("User not Eligible!");

        }

        
    }

    function userAuthorized(string memory _secret) private view {
      
        require(keccak256(abi.encodePacked(_secret)) == _secretHash, "User not Authorized!");
      
    }

    function userAuthTokenCheck(address _userAddress, uint256 _decData, uint256 _saltHash) private view {

        bytes32 authToken = keccak256(abi.encodePacked(_decData + _saltHash));
        if (_usersAuthToken[_userAddress][0] != uint256(authToken)){
            revert("not equal");
        }
       // require(_usersAuthToken[_userAddress][0] == keccak256(abi.encodePacked(_decData + _saltHash)), "User not Authorized!");
    
    }


    // get balance of contract address
    function getBalance() public view returns(uint256){
        return address(this).balance;
    }

    // for test: remove after production
    function test(address _userAddress) public view returns (uint256[] memory){
        
